/* Procedure structure for procedure `create_periode_barang` */

/*!50003 DROP PROCEDURE IF EXISTS  `create_periode_barang` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `create_periode_barang`(in_tgl TIMESTAMP, in_barang INT(11), in_penyimpanan ENUM('gudang','etalase'))
BEGIN
	IF( NOT EXISTS(SELECT periode FROM tb_periode_barang pb WHERE pb.periode = DATE_FORMAT(in_tgl,'%Y%m') 
	AND pb.barang_id = in_barang AND pb.penyimpanan = in_penyimpanan)) THEN
	   IF( NOT EXISTS(SELECT periode FROM tb_periode_barang pb WHERE pb.periode < DATE_FORMAT(in_tgl,'%Y%m') 
	   AND pb.barang_id = in_barang AND pb.penyimpanan = in_penyimpanan)) THEN
		INSERT INTO tb_periode_barang (periode, barang_id, penyimpanan, stok_awal) 
		SELECT DATE_FORMAT(in_tgl,'%Y%m'), in_barang, in_penyimpanan, 0;
	   ELSE
		INSERT INTO tb_periode_barang (periode, barang_id, penyimpanan, stok_awal) 
		SELECT DATE_FORMAT(in_tgl,'%Y%m'), in_barang, in_penyimpanan, IFNULL(stok_akhir,0) 
		FROM tb_periode_barang WHERE barang_id = in_barang AND penyimpanan = in_penyimpanan 
		AND periode < DATE_FORMAT(in_tgl,'%Y%m') 
		ORDER BY periode DESC LIMIT 1;
	   
	   END IF;
	END IF;
	
	INSERT INTO aktifitas_log(judul, deskripsi, deskripsi2) VALUES ('sp create periode barang',
	CONCAT(DATE_FORMAT(in_tgl,'%Y%m'),'|',in_barang,'|',in_penyimpanan),'');
    END */$$
DELIMITER ;

/* Procedure structure for procedure `update_periode_barang` */

/*!50003 DROP PROCEDURE IF EXISTS  `update_periode_barang` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `update_periode_barang`()
BEGIN
	DECLARE finished INTEGER DEFAULT 0;	
	DECLARE setbarang_id INT(11);
	DECLARE set_penyimpanan VARCHAR(30);
	
	DECLARE curs CURSOR FOR SELECT barang_id, penyimpanan FROM tb_periode_barang WHERE periode = DATE_FORMAT(NOW() - INTERVAL 1 MONTH,'%Y%m');
	DECLARE curs2 CURSOR FOR 
	SELECT b.id_barang, 'etalase' as gudangstok FROM tb_barang b union all
	SELECT b.id_barang, 'gudang' AS gudangstok FROM tb_barang b;
	
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;
    
	IF (EXISTS(SELECT periode FROM tb_periode_barang LIMIT 1)) THEN
	BEGIN 
		
        OPEN curs;
        SET finished = 0;
        REPEAT
        
            FETCH curs INTO setbarang_id, set_penyimpanan;
	    IF (setbarang_id IS NOT NULL AND set_penyimpanan IS NOT NULL) THEN
	    BEGIN 
		CALL create_periode_barang(NOW(),setbarang_id ,set_penyimpanan);
	    END;		
	    END IF;
            
        UNTIL finished END REPEAT;
        CLOSE curs;
        
    END;
	ELSE 
	BEGIN
		OPEN curs2;
		SET finished = 0;
		REPEAT
	
		FETCH curs2 INTO setbarang_id, set_penyimpanan;
		IF (setbarang_id is not null and set_penyimpanan is not null) THEN
		BEGIN 
			CALL create_periode_barang(NOW(),setbarang_id ,set_penyimpanan);
		end;		
		END IF;
		UNTIL finished END REPEAT;
		CLOSE curs2;
	END;
	END IF;
END */$$
DELIMITER ;

